import React, {Component} from 'react';
import './App.css';

import ListElement from '../components/list/list-element/list.element';

import List from '../components/list/list'

class App extends Component{
  state = {
    tasks: [
      {id: 0, status: "done", task:"primeira do dia"},
      {id: 1, status: "to do", task:"segunda do dia"},
    ]
    }

  render(){
    return(
      <div className='App'>
        <ListElement status=''>
          primeira tarefa do dia
        </ListElement>

        <List
          tasks = {this.state.tasks}

        />
      </div>
    )
  }
}

export default App;
